{
  inputs = {
    nixpkgs.url = "github:nixos/nixpkgs/nixpkgs-unstable";
  };
  outputs = {nixpkgs, ...}: let
    forAllSystems = function:
      nixpkgs.lib.genAttrs nixpkgs.lib.systems.flakeExposed
      (system: function nixpkgs.legacyPackages.${system});
  in {
    formatter = forAllSystems (pkgs: pkgs.alejandra);
    devShells = forAllSystems (pkgs: {
      default = pkgs.mkShell {
        packages = with pkgs; [
          bun
          corepack
          nodejs_20
        ];
      };
    });
  };
}

{
  "$schema": "https://turbo.build/schema.json",
  "ui": "tui",
  "globalDependencies": ["**/.env.*local"],
  "globalEnv": [
    "UPLOADTHING_TOKEN",
    "UPLOADTHING_TEST_TOKEN",
    "EXPO_PUBLIC_SERVER_ORIGIN",
    "UPLOADTHING_API_URL",
    "UPLOADTHING_INGEST_URL"
  ],
  "globalPassThroughEnv": [
    "VERCEL_URL",
    "VERCEL_ENV",
    "NODE",
    "NODE_ENV",
    "CI"
  ],
  "tasks": {
    "topo": {
      "dependsOn": ["^topo"]
    },
    "build": {
      "dependsOn": ["^build"],
      "outputs": [
        "dist/**",
        ".next/**",
        "!.next/cache/**",
        ".svelte-kit/**",
        ".vinxi/**",
        ".output/**",
        ".astro/**"
      ]
    },
    "lint": {
      "dependsOn": ["^topo", "^build"],
      "outputs": []
    },
    "dev": {
      "cache": false,
      "persistent": true,
      "interactive": true
    },
    "clean": {
      "cache": false
    },
    "typecheck": {
      "dependsOn": ["^topo", "^build"]
    },
    "//#test": {
      "dependsOn": []
    },
    "test": {
      "cache": false,
      "dependsOn": []
    },
    "test:watch": {
      "cache": false
    }
  }
}

import { existsSync, readdirSync } from "node:fs";
import { defineWorkspace, mergeConfig, ViteUserConfig } from "vitest/config";

const pkgRoot = (pkg: string) =>
  new URL(`./packages/${pkg}`, import.meta.url).pathname;
const alias = (pkg: string) => `${pkgRoot(pkg)}/src`;

const aliases = readdirSync(new URL("./packages", import.meta.url).pathname)
  .filter((dir) => existsSync(pkgRoot(dir) + "/package.json"))
  .filter((dir) => dir !== "uploadthing")
  .reduce<Record<string, string>>(
    (acc, pkg) => {
      acc[`@uploadthing/${pkg}`] = alias(pkg);
      return acc;
    },
    { uploadthing: alias("uploadthing") },
  );

const baseConfig: ViteUserConfig = {
  test: {
    mockReset: true,
    coverage: {
      provider: "v8",
      include: ["**/src/**"],
      exclude: ["**/docs/**", "**/examples/**", "**/tooling/**"],
    },
  },
  esbuild: { target: "es2020" },
  resolve: { alias: aliases },
};

export default defineWorkspace([
  mergeConfig(baseConfig, {
    test: {
      include: [
        "**/*.test.{ts,tsx}",
        "!**/*.browser.test.{ts,tsx}",
        "!**/*.e2e.test.{ts,tsx}",
      ],
      name: "unit",
      environment: "node",
    },
  } satisfies ViteUserConfig),
  mergeConfig(baseConfig, {
    test: {
      include: ["**/*.browser.test.{ts,tsx}"],
      name: "browser",
      browser: {
        provider: "playwright",
        enabled: true,
        name: "chromium",
      },
    },
  } satisfies ViteUserConfig),
]);
